import { BrowserRouter, Route, Switch } from "react-router-dom";
import "./App.css";
import Header from "./components/header/Header";
import HomePage from "./pages/homepage/HomePage";
import SongListPage from "./pages/songs/SongListPage";
import UserListPage from "./pages/users/UserListPage";
import SongAddPage from "./pages/songs/SongAddPage";
import LoginPage from "./pages/auth/LoginPage";

function App() {

  return (
    <BrowserRouter>
      <Header />
      <Switch>
        <Route exact path='/' component={HomePage}></Route>
        <Route path='/user_list' component={UserListPage}></Route>
        <Route path='/song_add' component={SongAddPage}></Route>
        <Route path='/song_list' component={SongListPage}></Route>
        {/*src2, 48ms25ss */}
        <Route path='/logIn' component={LoginPage}></Route>
      </Switch>
    </BrowserRouter>
  )
}

export default App;
